13.body:
You can now make players configure your mods via the options key in the meta block! Like so: [meta]
name="yeah"
options="enable_something,another_toggle" Pressing TAUNT on the mod menu while hovering an active mod will bring up the options related to that mod! Look ma, options! Options have a default value of zero, though these can be changed via the options block: [options]
enable_something="1" enable_something will now be "ON" by default. You can access these via referencing the option name in your scripts. if enable_something yeah();
else nah(); If the option enable_something is on, it'll call yeah() here, and if it's off, it will run nah() instead. Do note that this is NOT a global constant yet, and therefore is specified in the custom controller itself, so to access it within a with block be sure to prefix it with other. with (obj_player)
{ // This will error! if enable_something { } // This won't if other.enable_something { }
}

8.body:
Each mod works with a custom object (or controller) that runs the compiled gml files at runtime. This is akin to running gml code via obj_custom on ToppinLoader, though this is done by the mod loader itself instead of by you. You can create new custom controllers via instance_custom. // This will load scripts from scripts/obj_gooch
var gooch_id = instance_custom(0, 0, "obj_gooch");
// ... do stuff with gooch_id... // gooch scout digo real
persistent = false;
sprite_index = spr_pizzaface_haywire;
image_speed = 0.35;
maxspeed = 3; The above example will create a new custom controller running from the obj_gooch folder, and is instantiated from the init script. You can still create new custom controller objects the old way, though be wary of making them persistent and have a modname variable, which is the name value of your mod.ini's meta block. You can access the base object controller's modname via simply referencing the modname variable on it's own. // Insert cool stuff here
with (instance_create(0, 0, obj_customcontroller))
{ // custom object is now persistent, meaning it'll stay regardless of being in a new room or not. persistent = true; // best to pass in the base script's modname for referencing it when the mod is disabled modname = other.modname; // This custom controller will run even when paused. runPaused = true; // If you don't want to man handle the object created on different step files, you can also manually create gml snippets here as well! events.step = live_snippet_create(@' trace("Hello!"); ');
}

